/*Table structure for table `my_news_letter` */

DROP TABLE IF EXISTS `my_news_letter`;

CREATE TABLE `my_news_letter` (
  `id` int(11) NOT NULL auto_increment,
  `userid` int(11) NOT NULL,
  `datenewsletter` int(11) NOT NULL,
  `n_status` int(11) NOT NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `unique_data` (`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `my_news_letter` */

/*Table structure for table `my_notification` */

DROP TABLE IF EXISTS `my_notification`;

CREATE TABLE `my_notification` (
  `id` int(11) NOT NULL auto_increment,
  `userid` int(11) NOT NULL,
  `notification` text NOT NULL,
  `datetimes` datetime NOT NULL,
  `n_status` int(11) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `my_notification` */

/*Table structure for table `my_pages` */

DROP TABLE IF EXISTS `my_pages`;

CREATE TABLE `my_pages` (
  `id` int(11) NOT NULL auto_increment,
  `ownerid` int(11) NOT NULL,
  `name` varchar(200) NOT NULL,
  `description` text NOT NULL,
  `type` int(11) NOT NULL COMMENT 'type of this pages',
  `img` varchar(200) NOT NULL,
  `otherid` int(11) NOT NULL COMMENT 'PL id',
  `brandid` int(11) NOT NULL,
  `brandsubid` varchar(11) NOT NULL,
  `areaid` int(11) NOT NULL,
  `city` int(11) NOT NULL,
  `masterrole` int(11) NOT NULL,
  `created_date` datetime NOT NULL,
  `closed_date` datetime NOT NULL,
  `n_status` int(11) NOT NULL,
  PRIMARY KEY  (`id`),
  KEY `ownerid` (`ownerid`),
  KEY `name` (`name`),
  KEY `type` (`type`),
  KEY `created_date` (`created_date`),
  KEY `closed_date` (`closed_date`),
  KEY `otherid` (`otherid`),
  KEY `n_status` (`n_status`),
  KEY `city` (`city`)
) ENGINE=InnoDB AUTO_INCREMENT=194 DEFAULT CHARSET=utf8;

